import React, { Component } from 'react';
class Menu extends Component {
    constructor(props) {
        //create state
        super(props);
        this.state = {
            
        };
    }
    

    render() {
       
        return (
            <div style={{display:"flex", flexDirection:"column", justifycontent:"center",}}>
                {!this.props.state.student?(<div style={{cursor:"pointer",}} onClick={this.props.statesetter.bind(this,{viewstudent:false, metro:false,calendar: false, studentlist: false, chat:false })}>Dashboard</div>):(<div></div>)}
                {!this.props.state.student?(<div style={{cursor:"pointer",}} onClick={this.props.statesetter.bind(this,{viewstudent:true, metro:false,calendar: false, studentlist: false, chat:false })}>Students</div>):(<div style={{cursor:"pointer",}} onClick={this.props.statesetter.bind(this,{viewstudent:true, metro:false,calendar: false, studentlist: false, chat:false })}>Student</div>)}
                <div style={{cursor:"pointer",}} onClick={this.props.statesetter.bind(this,{viewstudent:false, metro:true,calendar: false, studentlist: false, chat:false })}>Metronome</div>
                <div style={{cursor:"pointer",}} onClick={this.props.statesetter.bind(this,{viewstudent:false, metro:false,calendar: true, studentlist: false, chat:false })}>Calendar</div>
                <div style={{cursor:"pointer",}} onClick={this.props.statesetter.bind(this,{viewstudent:false, metro:false,calendar: false, studentlist: false , chat:true})}>Chat</div>

            </div>

               
        );
    }
}

export default Menu;
